local OtherPlayers = {} --ToolsForLua.CreateDictionary()
print("init onUpdateOtherPlayer")
Network:registerMsgByLua("logic", "onUpdateOtherPlayer", function(msg, data)
    -- data:  {pid:{},pid2:{},pid3:{}}
    ClientTool.ForEachJsonObject(data, function(key, value)
        if OtherPlayers[key] == nil then
            OtherPlayers[key] = Network:createDataModel(playerModel)
        end
        OtherPlayers[key]:update(value)
    end)
end)

print("init rollingMessage")
Network:registerMsgByLua("logic", "rollingMessage", function(msg, data)
    --data: {txt:txt,times:times,interval:interval}
    require("uLuaModule/dialog/rollNoticeMrg")
    data = data.data
    if data.Count == 1 then
    	local str = decodeURI(data[0].txt)
        RollNoticeMrg:show(str, data[0].times, data[0].interval)
        return
    end
    for i = 0, data.Count - 1 do
    	local str = decodeURI(data[i].txt)
        RollNoticeMrg:show(str, data[i].times, data[i].interval)
    end
end)

